import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about-container">
      <h1>About MyDictionary App</h1>
      <p>
        This is a simple and powerful dictionary app where you can search meanings,
        synonyms, and listen to pronunciations of English words.
      </p>
    </div>
  );
};

export default About;
